import React from "react";

const Navbar = () => {
  return (
    <header>
      <nav>
        <div>Коталог домов</div>
        <div>Услуги</div>
        <div>О нас</div>
        <a href="">Контакты</a>
        <div>Блог</div>
      </nav>
    </header>
  );
};
export default Navbar;
